column8:
超小型犬～小型犬用・15mm幅・10m・約120g<br>
10色からお選び下さい。<br>
イエロー・ローズ・レッド・ブルー・グリーン・キャメル<br>オレンジ・ライトブルー・ラベンダー・シルバーグレー<br>
<br>
素材：ポリプロピレン<br>
金具：合金ニッケルメッキ<br>
<br>
受注生産のため3日ほどお日にちかかる場合があります<br>
オプション（+600円）で持ち手に革を付けることもできます。<br>
ご希望の方は選択肢「革持ち手付きについて」の中の【必要+600円】をお選び下さい。<br>
【要確認】<br>
※お客様都合の返品・交換には応じることはできません。<br>
どうかご了承くださいませ。<br>
<br>
※ゆうパケットのみ送料無料です<br>
郵便受けに投函されるため日時指定不可です。<br>
<br>
※ゆうパック（日時指定可）は送料（500～1440円）が必要です。<br>
<br>
※代引きをご希望の場合は別途ゆうパック送料（500～1440円）と代引き手数料（324円）が必要です。<br>
代引きをお選びの方は選択肢の「代引きについて」をご確認の上<br>
必ず「確認しました」をお選びくださいませ。<br>
<br>
※金具は告知なしで変更になる場合がございます。<br>
変更後も安心安全の金具であることに変わりはございません。<br>
<br>

